import axios from 'axios';
import { useEffect, useState } from 'react';
import {CakeCard} from './Cake_card'


export function Cakelist(props){
    var [cakes ,setcakes]=useState([])

    useEffect(()=>{
      let apiurl = "https://apifromashu.herokuapp.com/api/allcakes"

      axios(
        {
          method:'get',
         url:apiurl     }
      ).then((response)=>{
       
        setcakes(response.data.data)
      },(error)=>{
        console.log(error)
      })
    },[])

    return(
        <>
       
<div className="container">
<div className="d-flex  flex-xl-row justify-content-xl-between flex-column">
  {cakes.map((index,each)=>{<CakeCard key={index} data={each} />})}
 
</div>
</div>
        </>
    );
}
